import s from './Header.module.css'

const Header = (props) => {
    return(
        <div className={s.header}>
            <div>
                <img src = {props.photo}/>
            </div>
            <div className={s.d1}><h3><span>RUSSbook</span></h3></div>
            <div className={s.d1}><h4><span>{props.login}</span></h4></div>
        </div>
    )
}

export default Header;
